import React, { useContext, useState } from "react";

// react-bootstrap components
import {
  Button,
  Card,
  Form,
  Container,
  Row,
  Col,
} from "react-bootstrap";

import {
  collection,
  query,
  where,
  getDocs,
  doc,
  setDoc,
  updateDoc,
  addDoc
} from "firebase/firestore";

import { AuthContext } from "context/AuthContext";
import { db } from "database/firebase";

function AddExpense() {

  const [successfulCreation , setSuccessfullCreation] = useState(false);
  const [error , setError] = useState(false);

  const [expenseName, setExpenseName] = useState("");
  const [expenseCategory, setExpenseCategory] = useState("");
  const [expenseUnitPrice, setExpenseUnitPrice] = useState(0);
  const [expenseTotalPrice, setExpenseTotalPrice] = useState(0);

  const { currentUser } = useContext(AuthContext);


  const handleSubmit = async (e) => {
    
    e.preventDefault();

    try {
      const docRef = await addDoc(collection(db, "Expenses") , {
        expenseName,
        expenseCategory,
        expenseUnitPrice,
        expenseTotalPrice
      })

      console.log("Document written with ID: ", docRef.id);

    } catch (error) {
      console.log(error);
    }
  
  }

  return (
    <>
      <Container fluid>
        <Row>
          <Col md="12">
            <Card>
              <Card.Header>
                <Card.Title as="h4">Add Expense</Card.Title>
              </Card.Header>
              <Card.Body>
                <Form onSubmit={(e) => handleSubmit(e)}>
                  <Row>
                    <Col className=" px-1 ml-2" md="5">
                      <Form.Group>
                        <label>Expense Name</label>
                        <Form.Control
                          type="text"
                          value={expenseName}
                          onChange={e => setExpenseName(e.target.value)}
                          required
                        ></Form.Control>
                      </Form.Group>
                    </Col>
                    <Col className="pl-1" md="5">
                      <Form.Group>
                        <label htmlFor="exampleInputEmail1">
                          Expense Category
                        </label>
                        <Form.Control
                          type="text"
                          value={expenseCategory}
                          onChange={e => setExpenseCategory(e.target.value)}
                          required
                        ></Form.Control>
                      </Form.Group>
                    </Col>
                  </Row>
                  <Row>
                    <Col className="pr-1" md="4">
                      <Form.Group>
                        <label>Expense Unit Price</label>
                        <Form.Control
                          type="number"
                          value={expenseUnitPrice}
                          onChange={e => setExpenseUnitPrice(e.target.value)}
                          min="0"
                          required
                        ></Form.Control>
                      </Form.Group>
                    </Col>

                    <Col className="pr-1" md="6">
                      <Form.Group>
                        <label>Expense Total Price</label>
                        <Form.Control
                          value={expenseTotalPrice}
                          onChange={e => setExpenseTotalPrice(e.target.value)}
                          type="number"
                          min="0"
                          required
                        ></Form.Control>
                      </Form.Group>
                    </Col>
                  </Row>
                  <Button
                    className="btn-fill pull-right mt-1"
                    type="submit"
                    variant="info"
                  >
                    Add Expense
                  </Button>
                  { successfulCreation && (
                    <div className="clearfix mt-2">
                      <span className="text-success"></span> 
                    </div>
                  )}
                </Form>
              </Card.Body>
            </Card>
          </Col>
        </Row>

        
      </Container>
    </>
 
  )
}

export default AddExpense
